import './menuitem.scss'

export default function Menuitems({title ,imageUrl }) {
    return (
        <div className='menu-item' >
          <div className='content'>
           <h1 className='title'>{title.toUpperCase()}</h1>
           <span className='subtitle'>Shop Now</span>
          </div>
        </div>
    )
}
